xt_video?ref=watch\\u0026v=TFxgUTW_F3s\",\"rootVe\":83769}},\"urlEndpoint\":{\"url\":\"\/timedtext_video?ref=watch\\u0026v=TFxgUTW_F3s\"}}}]},\"noSubtitlesText\":{\"simpleText\":\"This video doesn't have subtitles or closed captions yet.\"},\"promoSubtitlesText\":{\"simpleText\":\"Help this video reach more people by contributing subtitles or closed captions in a language you speak.\"}}}}},\"videoDetails\":{\"videoId\":\"TFxgUTW_F3s\",\"title\":\"Systems and Components of an Offshore Sailing Catamaran - Lagoon 410 Walkthrough\",\"lengthSeconds\":\"2550\",\"keywords\":[\"sailing catamaran\",\"liveaboard sailboat\",\"sailing around the world\"],\"channelId\":\"UCaJ_xrKTkBWMNbc8G-2SIwA\",\"isOwnerViewing\":false,\"shortDescription\":\"Full Equipment List: https:\/\/sailingnahoa.com\/systems-and-components-of-an-offshore-sailing-catamaran\/\\nOur Sailmaker: http:\/\/bit.ly\/precision_sails\\n\\nAfter three and a half years of sailing around the world and well over 10000 nautical miles we wanted to give you a tour of our floating home as it is now. Nahoa is a 2005 Lagoon 410 owners version that has carried us all this way. We have worked hard over these last years to set her up for long term offshore cruising. While there is always a project list and a wish list (new high output alternators, spinnaker, new Genoa), we are very happy with our current setup and wanted to share it with you. \\n\\nOur longest video to date includes a high level view of our main power, navigation and safety systems that enable us to live life off the grid. Dont worry you also get a detailed tour of the inside of our boat and the comforts that keep us happily sailing around the world! \\n\\nNahoa has had a huge remodel since we purchased her in 2015. We have done 2 refits to get her setup for comfort and to solve our power requirements. If you want to check out the before of Nahoa you can watch our first walkthrough video here: https:\/\/youtu.be\/T6F1YvTLPJw\\nNotice all the beautiful green has been replaced? Well that isnt all! Below we have a list of some of the main components we have added or replaced. This list does not include basic maintenance items since those are essentially relentless. It does however cover some of the bigger items which were replaced as they broke and wore out. We have found that in the last year, as the boat turned 12-13 years old, we have had to replace more of the remaining systems. Also the previous owner had replaced standing rigging and so that is something we have not had to yet tackle, but it will come up again soon! So without further rambling, if you are curious please check the exhaustive list below and I hope you enjoy the tour. \\n\\nPrevious Walk Through: https:\/\/youtu.be\/T6F1YvTLPJw\\n\\nPLEASE SUBSCRIBE: http:\/\/bit.ly\/2EmmGnL\\n\\nWANT US TO MAKE MORE VIDEOS? https:\/\/www.patreon.com\/nahoa\/posts\\n\\nFOLLOW US:\\nAsh Instagram: https:\/\/www.instagram.com\/ashstobbart\/\\nBen Instagram: https:\/\/www.instagram.com\/captainbenb\/\\nFacebook: https:\/\/www.facebook.com\/sailingnahoa\/\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/TFxgUTW_F3s\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLCg5auGAChC3Uw-cBIFsg3hByUh0g\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/TFxgUTW_F3s\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLDhJBNAEf3lOd8mz2ovy7fMsROjpQ\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/TFxgUTW_F3s\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLBCwFyW4gJBAUcuKvNwyVf0MKaq7A\",\"width\":246,\"height\":138},{\"url\":\"https:\/\/i.ytimg.com\/vi\/TFxgUTW_F3s\/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLDD8JdbSRZi42z-AM3arm2dw588IA\",\"width\":336,\"height\":188},{\"url\":\"https:\/\/i.ytimg.com\/vi\/TFxgUTW_F3s\/maxresdefault.jpg\",\"wid %2Fsailingnahoa.com%2Fsystems-and-components-of-an-offshore-sailing-catamaran%2F\u0026redir_token=oOIWmaQThalzo3fC-nEr46sVGzh8MTU5MzAyOTU3NEAxNTkyOTQzMTc0\u0026v=TFxgUTW_F3s\u0026event=video_description","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=https%3A%2F%2Fsailingnahoa.com%2Fsystems-and-components-of-an-offshore-sailing-catamaran%2F\u0026redir_token=oOIWmaQThalzo3fC-nEr46sVGzh8MTU5MzAyOTU3NEAxNTkyOTQzMTc0\u0026v=TFxgUTW_F3s\u0026event=video_description","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\nOur Sailmaker: "},{"text":"http://bit.ly/precision_sails","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMIn9PJ4N-Y6gIVYRQGAB2IAgh9SPuu_K2TipiuTA==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=http%3A%2F%2Fbit.ly%2Fprecision_sails\u0026redir_token=oOIWmaQThalzo3fC-nEr46sVGzh8MTU5MzAyOTU3NEAxNTkyOTQzMTc0\u0026v=TFxgUTW_F3s\u0026event=video_description","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=http%3A%2F%2Fbit.ly%2Fprecision_sails\u0026redir_token=oOIWmaQThalzo3fC-nEr46sVGzh8MTU5MzAyOTU3NEAxNTkyOTQzMTc0\u0026v=TFxgUTW_F3s\u0026event=video_description","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\nAfter three and a half years of sailing around the world and well over 10000 nautical miles we wanted to give you a tour of our floating home as it is now. Nahoa is a 2005 Lagoon 410 owners version that has carried us all this way. We have worked hard over these last years to set her up for long term offshore cruising. While there is always a project list and a wish list (new high output alternators, spinnaker, new Genoa), we are very happy with our current setup and wanted to share it with you. \n\nOur longest video to date includes a high level view of our main power, navigation and safety systems that enable us to live life off the grid. Dont worry you also get a detailed tour of the inside of our boat and the comforts that keep us happily sailing around the world! \n\nNahoa has had a huge remodel since we purchased her in 2015. We have done 2 refits to get her setup for comfort and to solve our power requirements. If you want to check out the before of Nahoa you can watch our first walkthrough video here: "},{"text":"https://youtu.be/T6F1YvTLPJw","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMIn9PJ4N-Y6gIVYRQGAB2IAgh9","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=T6F1YvTLPJw","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"T6F1YvTLPJw"}}},{"text":"\nNotice all the beautiful green has been replaced? Well that isnt all! Below we have a list of some of the main components we have added or replaced. This list does not include basic maintenance items since those are essentially relentless. It does however cover some of the bigger items which were replaced as they broke and wore out. We have found that in the last year, as the boat turned 12-13 years old, we have had to replace more of the remaining systems. Also the previous owner had replaced standing rigging and so that is something we have not had to yet tackle, but it will come up again soon! So without further rambling, if you are curious please check the exhaustive list below and I hope you enjoy the tour. \n\nPrevious Walk Through: "},{"text":"https://youtu.be/T6F1YvTLPJw","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMIn9PJ4N-Y6gIVYRQGAB2IAgh9","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=T6F1YvTLPJw","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"T6F1YvTLPJw"}}},{"text":"\n\nPLEASE SUBSCRIBE: "},{"text":"http://bit.ly/2EmmGnL","navigationEndpoint":{"clickTrackingParams":"CJIBEM2rARgBIhMIn9PJ4N-Y6gIVYRQGAB2IAgh9SPuu_K2TipiuTA==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=http%3A%2F%2Fbit.ly%2F2EmmGnL\u0026redir_token=oOIWmaQThalzo3fC-nEr46sVGzh8MTU5MzAyOTU3NEAxNTkyOTQzMTc0\u0026v=TFxgUTW_F3s\u0026event=video_description","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=http%3A% al miles we wanted to give you a tour of our floating home as it is now. Nahoa is a 2005 Lagoon 410 owners version that has carried us all this way. We have worked hard over these last years to set her up for long term offshore cruising. While there is always a project list and a wish list (new high output alternators, spinnaker, new Genoa), we are very happy with our current setup and wanted to share it with you. \n\nOur longest video to date includes a high level view of our main power, navigation and safety systems that enable us to live life off the grid. Dont worry you also get a detailed tour of the inside of our boat and the comforts that keep us happily sailing around the world! \n\nNahoa has had a huge remodel since we purchased her in 2015. We have done 2 refits to get her setup for comfort and to solve our power requirements. If you want to check out the before of Nahoa you can watch our first walkthrough video here: https://youtu.be/T6F1YvTLPJw\nNotice all the beautiful green has been replaced? Well that isnt all! Below we have a list of some of the main components we have added or replaced. This list does not include basic maintenance items since those are essentially relentless. It does however cover some of the bigger items which were replaced as they broke and wore out. We have found that in the last year, as the boat turned 12-13 years old, we have had to replace more of the remaining systems. Also the previous owner had replaced standing rigging and so that is something we have not had to yet tackle, but it will come up again soon! So without further rambling, if you are curious please check the exhaustive list below and I hope you enjoy the tour. \n\nPrevious Walk Through: https://youtu.be/T6F1YvTLPJw\n\nPLEASE SUBSCRIBE: http://bit.ly/2EmmGnL\n\nWANT US TO MAKE MORE VIDEOS? https://www.patreon.com/nahoa/posts\n\nFOLLOW US:\nAsh Instagram: https://www.instagram.com/ashstobbart/\nBen Instagram: https://www.instagram.com/captainbenb/\nFacebook: http
